                                            type: 'datetime',
                                            tickPositions: temptimestamp,
                                            labels:   {
                                                            formatter: function() {//this.value是用tickPositions
                                                             return Highcharts.dateFormat('%Y%m%d', this.value);}
                                                    }
                                        },
                                    
                                    yAxis: [
                                                { // 第一个纵坐标轴（左边）
                                                    title: {
                                                        text: '指数'
                                                    },
                                                    opposite: false // 将此轴放在相对位置的反方向（右侧）
                                                },
                                                { // 第二个纵坐标轴（右边）
                                                    title: {
                                                        text: '数据'
                                                    },
                                                    opposite: true // 将此轴放在相对位置的反方向（右侧）
                                                }
                                            ],
                                    series:seriesData
                                }
                            );

    </script>
